import React from 'react';

const NotFound = () => {
    return (
        <section className="not-found">
            <h2 className="not-found__error-number">404</h2>
            <p className="not-found__subtitle">Страница не найдена</p>
            <Link></Link>
        </section>
    );
};

export default NotFound;
